import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './UserHome.css'
import { Container } from "react-bootstrap";
import Col from 'react-bootstrap/Col'
import Row from 'react-bootstrap/Row'

var body
var result
var key

class BidsToBuy extends Component {
    constructor(props) {
        super(props);
        this.state = {
            'items' : []
        };
    }
    componentDidMount() {
        const url = 'http://localhost:9000/getCrops'
        console.log(this.props.fid)
        let headers = new Headers();

        headers.append('Content-Type', 'application/json');
        headers.append('Accept', 'application/json');

        headers.append('Access-Control-Allow-origin', url);
        headers.append('Access-Control-Allow-Credentials', 'true');

        headers.append('POST', 'GET');

        fetch(url,{
            headers: headers,
            method: 'GET',
            body: JSON.stringify(body)
        })
        .then(response => response.json()) 
        .then(response => this.setState({ 'items' : response}));          
    }

   handleSubmit = (event) => {
        event.preventDefault();
        window.location.href  = "/bidding/";
    }

    render(){
        return (
            <div class = "recentbids">
            <div className="auth-inner">
               <ul>
                   {this.state.items.map(function(item){
                       return(
                           <div key={item.id}>
                                <Row>
                                        <Col>{item.name}</Col><Col>{item.area}</Col><Col>{item.location}</Col><Col>{item.price}</Col>
                                        <Col><button className="btn btn-success btn-block" onClick={() => this.handleSubmit.bind(this)}>Bid</button></Col>
                                </Row><Row><br/></Row>
                           </div>
                       )
                   })}
               </ul>
            </div>   
            </div>
        );
    }
}

export default BidsToBuy;
